import React from "react";
import SearchIcon from "@material-ui/icons/Search";
import ClearIcon from "@material-ui/icons/Clear";
import IconButton from "@material-ui/core/IconButton";

const SearchDate = (props) => {
  return (
    <div style={{margin: '15px 0px 0px 15px'}}>
      {props.label}
      <InputSearch style={{background: 'pink'}} type="date" placeholder="enter date" onChange={props.handleSearchDate}/>
    </div>
  )
};

const InputSearch = (props) => {
  return (
    <input
          style={{ width: "60%", paddingLeft: "5px", background: 'pink', border: 'solid', borderWidth: '0.2px', borderColor: 'white'}}
          placeholder={props.placeholder}
          onChange={props.onChange}
          value={props.value}
          type={props.type}
        />
  );
}

class SearchAppBar extends React.Component {
  state = {
    text: "",
    dueDate: "",
    priority: false,
    completed: false,
    datePickerIsOpen: false,
  };
  render() {
    return (
      <div style={{ display: "flex", marginTop: "0px", background: 'pink'}}>
        <SearchIcon style={{ marginTop: "15px" }} />
        <InputSearch
          placeholder="enter search text"
          onChange={this.props.handleSearchText}
          value={this.props.data.filterText}
        />

        <SearchDate
          label="filter date"
          handleSearchDate={this.props.handleSearchDate}
          value={this.props.data.filterDate}
        />

        <IconButton aria-label="Delete" onClick={this.props.clearAllSearch}>
          <ClearIcon />
        </IconButton>
      </div>
    );
  }
}

export default SearchAppBar;
